// ========================================
// TRANSFORMACIÓN DE LEAD KOMMO → POSTGRESQL
// ========================================

const lead = $('Split Out1').item.json;
const statuses = $('HTTP Request Statuses').first().json._embedded?.statuses || [];
const contact = $('Split Out1').item.json._embedded?.contacts?.[0] || {};

// Función helper para obtener custom field
function getCF(fieldName) {
  const cf = (lead.custom_fields_values || []).find(x => x.field_name === fieldName);
  return (cf && cf.values && cf.values[0]) ? cf.values[0].value : null;
}

// Función helper para campos booleanos (toggle/checkbox)
function getCFBool(fieldName) {
  const val = getCF(fieldName);
  return (val === true || val === 1 || val === '1') ? 1 : 0;
}

// Función para obtener teléfono del contacto
function getPhone() {
  const phoneField = (contact.custom_fields_values || []).find(f => f.field_name === 'Phone');
  return phoneField?.values?.[0]?.value || null;
}

// Función para obtener nombre del status
function getStatusName(statusId) {
  const hit = statuses.find(s => String(s.id) === String(statusId));
  return hit?.name || '';
}

// Función para parsear fecha Unix a ISO
function unixToISO(unix) {
  if (!unix) return null;
  return new Date(unix * 1000).toISOString().replace('T', ' ').substring(0, 19);
}

// Función para calcular fecha del lunes de la semana
function getMonday(date) {
  const d = new Date(date);
  const day = d.getDay();
  const diff = (day === 0 ? -6 : 1) - day;
  d.setDate(d.getDate() + diff);
  return d.toISOString().split('T')[0];
}

// ========================================
// EXTRACCIÓN DE CAMPOS
// ========================================

// Códigos de propiedad
const codInmueble = getCF('codigoInmueble');
const codPropiedad = getCF('n8n - CODPROPIEDAD');
const codUnificadoRaw = codInmueble || codPropiedad || null;

// Normalizar MODO
let codUnificado = codUnificadoRaw;
if (codUnificadoRaw && codUnificadoRaw.toString().toUpperCase().includes('MODO')) {
  codUnificado = 'MODO';
}

// Origen: priorizar LinkUrbania, sino n8n - Origen
const linkUrbania = getCF('LinkUrbania');
let origen = getCF('n8n - Origen') || 'SIN_ORIGEN';
if (linkUrbania) {
  origen = 'URBANIA';
}

// Fechas de horarios
const fecha1 = getCF('n8n - fecha1');
const fecha2 = getCF('n8n - fecha2');
const fechaModo = getCF('n8n - fechaMODO');
const dioHorario = (fecha1 || fecha2 || fechaModo) ? 1 : 0;

// Fecha de creación y derivadas
const fechaCreacionUnix = lead.created_at;
const fechaCreacion = unixToISO(fechaCreacionUnix);
const fechaDia = fechaCreacion ? fechaCreacion.substring(0, 10) : null;
const fechaMes = fechaDia ? fechaDia.substring(0, 7) + '-01' : null;
const fechaSemana = fechaCreacionUnix ? getMonday(new Date(fechaCreacionUnix * 1000)) : null;

// Tipo cliente
const tipoCliente = getCF('n8n - TipoCliente');
const esNuevo = (tipoCliente === 'NUEVO') ? 1 : 0;

// Caso especial: por campo O por status_id
const casoEspecialCampo = getCFBool('n8n - supp - caso_especial');
const casoEspecialStatus = (lead.status_id === 90801084) ? 1 : 0;
const casoEspecial = (casoEspecialCampo || casoEspecialStatus) ? 1 : 0;

// ========================================
// OBJETO FINAL
// ========================================

return {
  json: {
    // Identificadores
    id: lead.id,

    // Datos básicos
    nombre: contact.name || null,
    telefono: getPhone(),
    fecha_creacion: fechaCreacion,
    status_id: lead.status_id,
    etapa: getStatusName(lead.status_id),

    // Propiedad
    cod_inmueble: codInmueble,
    cod_propiedad: codPropiedad,
    cod_propiedad_unificado: codUnificado,
    inmueble_identificado: codUnificadoRaw ? 1 : 0,
    link_urbania: linkUrbania,

    // Origen
    origen: origen,

    // Bot - Respuesta
    bot_respondio: getCFBool('rentas_mensajeia_salio'),
    bot_apagado_manual: getCFBool('rentas_bot_apagado_manual'),
    bot_fecha_ult_msg: getCF('bot - fecha_ult_msg'),

    // Bot - Horarios
    dio_horario: dioHorario,
    genero_horario: getCFBool('rentas_ia_generohorario'),
    horario_registrado: getCFBool('rentas_ia_generohorario_registrado'),
    horario_notificado: getCFBool('rentas_ia_generohorario_notificado'),
    fecha1: fecha1,
    fecha2: fecha2,
    fecha_modo: fechaModo,

    // Bot - Errores
    tuvo_error: getCFBool('n8n - supp - es_error'),
    detalle_error: getCF('n8n - supp - detalle_es_error'),
    error_marcado: getCFBool('rentas_error_marcado'),
    estado_correccion: getCF('n8n - corregido') || 'N/A',
    detalle_correccion: getCF('n8n - detalle corregido'),

    // Bot - Caso especial
    caso_especial: casoEspecial,
    detalle_caso_especial: getCF('n8n - supp - detalle_caso_especial'),

    // Bot - Seguimiento
    seg1: getCF('n8n - supp - seg1'),
    seg2: getCF('n8n - supp - seg2'),
    animo: getCF('n8n - animo') || getCF('n8n - supp - animo'),
    tiene_solucion: getCFBool('n8n - supp - tiene_solucion'),
    cliente_identificado: getCFBool('n8n - supp - clienteIdentificado'),

    // Cliente
    tipo_cliente: tipoCliente,
    es_nuevo: esNuevo,

    // Fechas calculadas
    fecha_dia: fechaDia,
    fecha_semana: fechaSemana,
    fecha_mes: fechaMes
  }
};
